sys_variable_value.value:
(function execute(inputs, outputs) {

  if(inputs.status_code == '200') {

    var responseBody = JSON.parse(inputs.response_body);

    var docsArray = responseBody.response.docs;

    outputs.journal = docsArray[0].journal;
    outputs.publication_date = docsArray[0].publication_date;
    outputs.article_type = docsArray[0].article_type;
    outputs.score = docsArray[0].score;
  }
})(inputs, outputs);

